`,r(e.h2,{children:"Enabling and Supporting Enterprise Migrations to F#/Fable"}),`
`,r(e.p,{children:"Components can quickly and easily be migrated to Fable, or new components can be written in Fable, while having an output that is recognisable and usable by the legacy team."}),`
`,r(e.p,{children:"In combination with storybook (with soon to come Data Contract-like abstractions), there is nothing holding you and your team back."}),`
`,r(e.h2,{children:"Usability and Distributability as a JavaScript package"}),`
`,r(e.p,{children:"Within enterprise or open-source circles, having a readable source can be a deciding factor in whether your product is used or not. Having a source code that users can help maintain through pulls/issues etc is a massive boon."}),`
`,r(e.p,{children:"Since our DSL is so close to the native JSX, there is minimal cognitive load in translating any pull to the F# source."}),`
`,r(e.p,{children:"Hopefully, the advent of our over-hyped useless AI janitors will assist in this area."}),`
`,r(e.h2,{children:"Taking Advantage of Solid-JS Optimisations and Helpers"}),`
`,r(e.p,{children:"With JSX being the new default method of writing the web, many libraries and frameworks are investing into performing their optimisations from parsed JSX. Similarly, there are utilities which are designed for use in JSX that may not be easily portable to Fable otherwise."}),`
`,r(e.h2,{children:"Less Surprises while Debugging"}),`
`,r(e.p,{children:"When you're making your UI, it is not uncommon for something to go awry."}),`
`,r(e.p,{children:"By compiling to a clean JSX output, you have an exponentially greater chance of honing in on the fix."}),`
`,r(e.p,{children:"You're not limited to the size of the F# or Fable community. You now are capable of asking for help from the massive pool of front end developers with a reproducible example in hand."}),`
`,r(e.p,{children:"You also won't be surprised by a Fable, F# or Plugin bug, because you can easily determine whether your intention has been reflected in your output."}),`
